void visit(ImageElement element, String value) throws IOException {
  if(inInode) {
    switch(element) {
    case INODE_PATH:
      current.path = (value.equals("") ? "/" : value);
      break;
    case REPLICATION:
      current.replication = Integer.valueOf(value);
      break;
    case NUM_BYTES:
      current.fileSize += Long.valueOf(value);
      break;
    default:
      break;
    }
  }
}
